import React, { useState } from 'react'
import { useDispatch } from "react-redux";
import { login_user } from '../redux/actions'
import '../styles.css'


const login = () => {
    return(
        
        <div className="myStyle" >    
        <form method="POST" action="/login">
            <div className="form-group">
              <div className="text-white display-6">Welcome Back</div>
              <label className="text-white">Username</label>
              <input className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter Username" name="user" />
              
            </div>
            <div className="form-group">
              <label className="text-white">Password</label>
              <input type="password" className="form-control" id="exampleInputPassword1" placeholder="Password" name="password" />
            </div>
          
            <button type="submit" className="btn btn-primary" style={{marginTop: 5}} >Log In</button>
          </form> 
          </div>
            
    );
}

export default login;
